import React from 'react';
import styled from 'styled-components';

const ButtonWrapper = styled.div`
  position: fixed;
  padding: 10px;
  bottom: 0;
  left: 130px;
  background: #c1dafe;
  max-width: 100px;

  button {
    padding: 5px;
    background: white;
    margin: 5px;
    cursor: pointer;
    border: 1px solid grey;
    border-radius: 5px;
  }
`;

const buttons = [
  {
    label: '新增 - 背景',
    className: 'add-background',
    onClick: () => {
      // 处理新增背景的逻辑
    },
  },
  {
    label: '新增 - 文字',
    className: 'add-font',
    onClick: () => {
      setShowFont(true);
    },
  },
  {
    label: '新增 - 圖片',
    className: 'add-image',
    onClick: () => {
      setShowFontBox(true);
    },
  },
  {
    label: '刪除元件',
    className: 'delete-element',
    onClick: () => {
      // 处理删除元件的逻辑
    },
  },
];

export default function ElementButtons({ setShowFontLightBox }) {
  return (
    <ButtonWrapper>
      {buttons.map((button, index) => (
        <button
          key={index}
          className={button.className}
          onClick={button.onClick}
        >
          {button.label}
        </button>
      ))}
    </ButtonWrapper>
  );
}
